describe('manifestParser', function () {
  it('correctly parses a dash playback info', async () => {
    const result = parseManifest({
      expires: 0,
      ...dashPlaybackInfoTrack,
    });

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('170651820');

    expect(result.streamUrl).to.equal(
      `data:${dashPlaybackInfoTrack.manifestMimeType};base64,${dashPlaybackInfoTrack.manifest}`,
    );
    expect(result.quality).to.equal(dashPlaybackInfoTrack.audioQuality);

    expect(result.streamingSessionId).to.not.equal(undefined);
    expect(result.sampleRate).to.equal(undefined);

    expect(result.codec).to.equal('flac');
  });

  it('correctly parses a bts playback info', async () => {
    const result = parseManifest({
      expires: 0,
      ...btsPlaybackInfo,
    });

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('173307641');

    expect(result.streamUrl).to.not.equal(undefined);
    expect(result.quality).to.equal(btsPlaybackInfo.audioQuality);

    expect(result.streamingSessionId).to.not.equal(undefined);
    expect(result.sampleRate).to.equal(undefined);

    expect(result.codec).to.equal('mp3');
  });

  it('correctly parses a emu playback info', async () => {
    const result = parseManifest({
      expires: 0,
      ...emuPlaybackInfo,
    });

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('260112906');

    expect(result.streamUrl).to.not.equal(undefined);
    expect(result.quality).to.equal(emuPlaybackInfo.audioQuality);

    expect(result.streamingSessionId).to.not.equal(undefined);
    expect(result.sampleRate).to.equal(undefined);

    expect(result.codec).to.equal('aac');
  });

  it('correctly parses a dash track manifest with FLAC codec', async () => {
    const result = parseManifest(dashTrackManifestFlac);

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('369342744');

    expect(result.streamUrl).to.equal(
      `data:${dashTrackManifestFlac.manifestMimeType};base64,${dashTrackManifestFlac.manifest}`,
    );
    expect(result.quality).to.equal(dashTrackManifestFlac.audioQuality);
    expect(result.streamingSessionId).to.equal(
      dashTrackManifestFlac.streamingSessionId,
    );

    expect(result.codec).to.equal('flac');
    expect(result.sampleRate).to.equal(44100);
    expect(result.bitDepth).to.equal(24);
    expect(result.duration).to.be.closeTo(284.066, 0.01);
  });

  it('correctly parses a dash track manifest with AAC codec', async () => {
    const result = parseManifest(dashTrackManifestAAC);

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('464577540');

    expect(result.streamUrl).to.equal(
      `data:${dashTrackManifestAAC.manifestMimeType};base64,${dashTrackManifestAAC.manifest}`,
    );
    expect(result.quality).to.equal(dashTrackManifestAAC.audioQuality);
    expect(result.streamingSessionId).to.equal(
      dashTrackManifestAAC.streamingSessionId,
    );

    expect(result.codec).to.equal('aac');
    expect(result.sampleRate).to.equal(44100);
    expect(result.duration).to.be.closeTo(217.055, 0.01);
  });

  it('correctly parses a HLS track manifest with FLAC codec', async () => {
    const result = parseManifest(hlsTrackManifestFlac);

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('14306374');

    expect(result.streamUrl).to.equal(
      `data:${hlsTrackManifestFlac.manifestMimeType};base64,${hlsTrackManifestFlac.manifest}`,
    );
    expect(result.quality).to.equal(hlsTrackManifestFlac.audioQuality);
    expect(result.streamingSessionId).to.equal(
      hlsTrackManifestFlac.streamingSessionId,
    );

    expect(result.codec).to.equal('flac');
    expect(result.sampleRate).to.equal(96000);
    expect(result.bitDepth).to.equal(24);
    expect(result.duration).to.be.closeTo(272.685, 0.01);
  });

  it('correctly parses a HLS track manifest with AAC codec', async () => {
    const result = parseManifest(hlsTrackManifestAAC);

    expect(result.type).to.equal('track');
    expect(result.id).to.equal('17178313');

    expect(result.streamUrl).to.equal(
      `data:${hlsTrackManifestAAC.manifestMimeType};base64,${hlsTrackManifestAAC.manifest}`,
    );
    expect(result.quality).to.equal(hlsTrackManifestAAC.audioQuality);
    expect(result.streamingSessionId).to.equal(
      hlsTrackManifestAAC.streamingSessionId,
    );

    expect(result.codec).to.equal('aac');
    expect(result.duration).to.be.closeTo(337.247, 0.01);
    // AAC HLS manifests don't include X-COM-TIDAL-SAMPLE-RATE
    expect(result.sampleRate).to.equal(undefined);
  });
});
